import React from "react";

const Profile = () => {
  const user = {
    name: "John Doe",
    email: "johndoe@example.com",
    role: "Administrator",
    joined: "January 15, 2024",
    profilePic: "https://via.placeholder.com/150"
  };

  return (
    <div className="container mx-auto p-6 bg-white shadow-lg rounded-lg max-w-md text-center">
      <img
        src={user.profilePic}
        alt="Profile"
        className="w-32 h-32 mx-auto rounded-full mb-4 border-4 border-blue-500"
      />
      <h1 className="text-2xl font-bold text-gray-800">{user.name}</h1>
      <p className="text-gray-600">{user.email}</p>
      <p className="text-gray-700 font-semibold">Role: {user.role}</p>
      <p className="text-gray-500">Joined: {user.joined}</p>
      <button className="mt-4 bg-blue-500 text-white px-4 py-2 rounded-lg hover:bg-blue-600">
        Edit Profile
      </button>
    </div>
  );
};

export default Profile;
